import {
  useNowState,
  useNowDispatch,
  getNow,
  getUp,
  getTop,
} from "./MoviesContext";
import styled from "styled-components";

const Main = () => {
  useEffect(() => {
    fetchData();
  }, []);

  const state = useNowState();
  const dispatch = useNowDispatch();

  const { data: topList, loading, error } = state.top;

  const fetchData = () => {
    getTop(dispatch);
  };

